import styled from "styled-components";

export const StyledHome = styled.div`
  display: flex;
  align-content: center;
  justify-content: center;
  align-items: center;
  height: 90vh;
  border: solid blue;
  margin-left: 100px;

  .hello {
    display: flex;
  }

  h1,
  h5 {
    color: #fefefe;
    margin: 0 0;
    padding: 0 0;
    border: solid blue;
  }

  h1 {
    font-size: 80px;
    /* border: solid white; */
  }

  h5 {
    font-size: 21px;
    /* border: solid white; */
  }

  img {
    margin-left: 80px;
    height: 480px;
  }
`;
